import HelloWorld from './components/helloworld';
import Frases from './components/Frases';  
import DigaMeuNome from './components/DigaMeuNome';

function App() {
  return (
    <div className="App">
      <h1>MEU APP REACT</h1>
      <HelloWorld />
      <Frases /> 
      <DigaMeuNome nome= "roblox" /> 
    </div>
  );
}

export default App;
